pub enum Visibility {
    Public(VisPublic),
    Crate(VisCrate),
    Restricted(VisRestricted),
    Inherited,
}

pub enum GenericParam {
    Type(TypeParam),
    Lifetime(LifetimeDef),
    Const(ConstParam),
}

pub enum WherePredicate {
    Type(PredicateType),
    Lifetime(PredicateLifetime),
    Eq(PredicateEq),
}

pub enum UnOp {
    Deref(crate::token::Star),
    Not(crate::token::Bang),
    Neg(crate::token::Sub),
}

pub enum Stmt {
    Local(Local),
    Item(Item),
    Expr(Expr),
    Semi(Expr, crate::token::Semi),
}

pub fn parse_separated_nonempty_with(ParseStream,
                                     fn(: ParseStream) -> Result<T>)
-> Result<Self> where P: Token + Parse
